import Header from "./Header";

const layoutStyle = {
  padding: 20,
  maxWidth: "1280px",
  margin: "auto 0",
};

const Layout = (props) => (
  <div style={layoutStyle}>
    <Header />
    {props.children}
  </div>
);

export default Layout;
